import React from 'react';
import { Nav } from 'react-bootstrap';
import './HelpSidebar.css';

const HelpSidebar = () => {
  return (
    <div className="sidebar-section">
      <h5>Ay√∫danos</h5>
      <Nav className="flex-column">
        <Nav.Link href="#">Adopta o acoge</Nav.Link>
        <Nav.Link href="#">Hazte socio o padrino</Nav.Link>
        <Nav.Link href="#">Hazte voluntario</Nav.Link>
        <Nav.Link href="#">Dona</Nav.Link>
        <Nav.Link href="#">Tienda Solidaria</Nav.Link>
        <Nav.Link href="#">Contacta con nosotros</Nav.Link>
      </Nav>
    </div>
  );
};

export default HelpSidebar;
